import React from "react";
import styled from "styled-components";
import Header from "../components/header/Header";
import BodyLayout from "../components/body/BodyLayout";
import Footer from "../components/footer/Footer";

const NoticeTitle = styled.div`
  width: 1200px;
  margin-top: calc(var(--margin-default) * 3);
  margin-bottom: var(--margin-default);
  font-size: var(--font-size-title-normal);
`;

const NoticeContainer = styled.ul`
  width: 1200px;
  height: 800px;
  overflow: hidden;
`;

const NoticeItem = styled.li`
  width: 100%;
  height: 60px;
  border-bottom: 1px solid black;
  display: flex;
  align-items: center;
  text-align: center;
  :first-child {
    font-size: var(--font-size-title-small);
  }
`;

const SmallBox = styled.div`
  width: 10%;
  i {
    font-size: var(--font-size-large);
  }
  i:hover {
    cursor: pointer;
    color: var(--color-pink);
  }
`;

const TitleBox = styled.div`
  width: 60%;
`;

const ItemTitleBox = styled(TitleBox)`
  text-align: left;
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
  :hover {
    cursor: pointer;
    color: var(--color-pink);
  }
`;

const SearchBar = styled.div`
  width: 1200px;
  height: 60px;
  display: flex;
  justify-content: flex-end;
  align-items: center;
  background-color: red;
  font-size: var(--font-size-large);
  input {
    padding: calc(var(--padding-default) / 4);
    margin-right: calc(var(--margin-default) / 2);
    font-size: var(--font-size-large);
  }
  i {
    margin-right: calc(var(--margin-default));
  }
`;

const Notice = () => {
  return (
    <>
      <Header />
      <BodyLayout>
        <NoticeTitle>공지사항</NoticeTitle>
        <NoticeContainer>
          <NoticeItem>
            <SmallBox>번호</SmallBox>
            <TitleBox>제목</TitleBox>
